INSERT INTO `topics` (`id`, `name`, `description`, `status`, `date_created`, `date_updated`) VALUES
(2, 'Hunger', '&lt;p&gt;We serve to improve human flourishing. We see how the global hunger and nutrition crisis bears upon our local communities, and believe true community improvement depends on the thriving of its members.&lt;br&gt;&lt;/p&gt;', 1, '2021-08-17 08:53:01', '2023-06-16 13:29:35'),
